import React from 'react';
import ContactInterface from "../ContactInterface/ContactInterface";

const ContactContainer = () => {
    let users = {};
    const state = [
        {
            name: "nigel",
            lastName: "Maduro",
            age: 28
        },
        {
            name: "Metsu",
            lastName: "Akai",
            age: 12
        },
        {
            name: "Carol",
            lastName: "Lieds",
            age: 22
        },
        {
            name: "Men",
            lastName: "Croes",
            age: 89
        }
    ];
    users = state.map((user, i) => {
            return <ContactInterface key={i} name={user.name} lastName={user.lastName} age={user.age}/>
    });

    return <>{users}</>
};

export default ContactContainer;
